import axios from "axios";
import { render } from "nunjucks";
import React, { useEffect, useState } from "react";

const SetSelect = () => {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get("https://api.scryfall.com/sets")
        .then(res => {
            setData(res.data.data.map(set => 
                <option key={set.id}>{set.name}</option>))
        })      
    }, []);

    createPack = () => {
        useEffect(() => {
            axios.get(`https://api.scryfall.com/sets/${res.data.data.mtgo_code}`)
        })
    }

    return(
    <select onSelect={createPack}>
        {data}
    </select>
    )
}

export default SetSelect
